  const title = 'Superadvanced web phonebook app'
  return (
    <div>
      <p>{title}</p>
    </div>
  )
}

const Contents = () => {

  const name1 = 'John Doe'
  const phone1 = '358401234567'
  const name2 = 'Jane Doe'
  const phone2 = '44551234567'
  const name3 = 'Foo bar'
  const phone3 = '000'

  return (
    <div>
      <p>{name1}</p>
      <p>{phone1}</p>
      <p>{name2}</p>
      <p>{phone2}</p>
      <p>{name3}</p>
      <p>{phone3}</p>
    </div>
  )
}

const App = () => {

